import React from 'react';

import "./../styles/Discover.css";

const Discover = () => {
    return (
      <div className="about-us">
        <h1>Discover Quik Chefs</h1>
        <div className="about-content">
          <p>
            Quik Chefs was founded by Rising CMG Pvt. Ltd. with a mission to transform the culinary landscape in India. Our commitment to quality, creativity, and professionalism drives us to deliver exceptional culinary experiences. With a talented team led by Chef Anjali Sharma, who specializes in Indian and fusion cuisine, and Rajiv Mehta, our Operations Manager ensuring seamless event execution, we are dedicated to exceeding client expectations. Our values reflect our dedication to high standards and innovative solutions, making us a trusted partner in the hospitality industry. Join us in our journey to elevate dining experiences across India.
          </p>
        </div>
      </div>
    );
  };

  export default Discover;
